<title>Thank you for Applying to Amazon!</title>
</head>

<body>
<center style="width: 100%; table-layout: fixed; -webkit-text-size-adjust: 100%; -ms-text-size-adjust: 100%;">
  <div>
    <table id="main" border="0" cellpadding="0" cellspacing="0" align="center" style="margin: 0;width:100%;" role="presentation">
