              </tbody>
            </table>
          </td>
        </tr>
        <tr>
          <td id="copy" style="font-family: 'Amazon Ember', sans-serif; font-size: 14px; line-height: 22px; text-align: left;">
            <table style="border:0;border-spacing: 0;border-collapse: collapse;margin: 0;width:100%;" role="presentation">
              <tbody style="padding:0; margin:0;">
                <tr height="100px" style="padding:0; margin:0;">
                  <td bgcolor="#17202D" height="100px" width="auto" style="padding:0; margin:0;"></td>
                  <td rowspan="2" style="padding:0; margin:0; width: 800px;" bgcolor="#fff">
                    <div style="margin: 0; border-top: solid #FF8900 4px;"></div>
                    <div style="padding: 20px">
                      
                        <h1>Hi Amit,</h1>
<p>Thanks for applying to Amazon! We've received your application for the <a href="https://9n3bwgl2.r.us-west-2.awstrack.me/L0/https:%2F%2Famazon.jobs%2Fjobs%2F2937484/1/02010000dqf498qe-5521e76a-uvmk-bqad-lkkb-je8ekvgnaig0-000000/drNe44G2O52JVgy9NlWDjjrGd8U=433">Machine Learning Engineer II, Special Projects</a> (ID: 2937484) position.</p><h2>What happens next?</h2><p>If we decide to move forward with your application, the Amazon recruiting team will reach out to discuss next steps. Any updates to your application status will be reflected on your Application dashboard, so be sure to check back regularly.</p>

  <div class="btn-container">
    <a href="https://9n3bwgl2.r.us-west-2.awstrack.me/L0/https:%2F%2Faccount.amazon.jobs%2Fcandidate%2Fdashboard%2Fapplications/1/02010000dqf498qe-5521e76a-uvmk-bqad-lkkb-je8ekvgnaig0-000000/4ibxbjMQEif7Zj298FxPTI5RDxQ=433" class="btn">Go to your application dashboard</a>
  </div>

<p>Explore our <a href="https://9n3bwgl2.r.us-west-2.awstrack.me/L0/https:%2F%2Fwww.amazon.jobs%2Fcontent%2Fen%2Fhow-we-hire%2Finterviewing-at-amazon%3Fcmpid=AS_OTBD200012B/1/02010000dqf498qe-5521e76a-uvmk-bqad-lkkb-je8ekvgnaig0-000000/2tJsdzV46pBWpoMox_7vY6Q6poA=433">interview resources</a> for more information on the hiring process and how to prepare for interviews. To learn more about our peculiar culture, visit <a href="https://9n3bwgl2.r.us-west-2.awstrack.me/L0/https:%2F%2Famazon.jobs/1/02010000dqf498qe-5521e76a-uvmk-bqad-lkkb-je8ekvgnaig0-000000/K-BBYYdg0iItaTD2pGfTlwtIPZ8=433">Amazon.jobs</a>, and get the latest Amazon news and stories by following our <a href="https://9n3bwgl2.r.us-west-2.awstrack.me/L0/https:%2F%2Fblog.aboutamazon.com%2F/1/02010000dqf498qe-5521e76a-uvmk-bqad-lkkb-je8ekvgnaig0-000000/Te3wq_ZQxaTRbVfa98lOweB_6lw=433">Day One blog</a>.</p>


<p>Best regards,<br /><span class="font-bold">Amazon Recruiting Team</span></p>


  <span class="font-small font-italic"><p>
    
      Amazon is an equal opportunity employer. Protecting your privacy and the security of your data are longstanding top priorities for Amazon. If you are an external candidate, please consult our <a href="https://9n3bwgl2.r.us-west-2.awstrack.me/L0/https:%2F%2Famazon.jobs%2Fprivacy%2Fglobal/1/02010000dqf498qe-5521e76a-uvmk-bqad-lkkb-je8ekvgnaig0-000000/_S-y3c7t82hjmwAboogxiOkIJG8=433">Privacy Notice</a> to know more about how we collect, use, and transfer the personal data of our candidates. You can let us know if you do not want to be contacted for recruitment purposes. Please refer to the "What are my rights under applicable data protection laws?" section of the <a href="https://9n3bwgl2.r.us-west-2.awstrack.me/L0/https:%2F%2Famazon.jobs%2Fprivacy%2Fglobal/2/02010000dqf498qe-5521e76a-uvmk-bqad-lkkb-je8ekvgnaig0-000000/NSeWiNRXA2Nd71c1LBD3WBlG4LY=433">Notice</a> for more information. If you are an internal candidate, please consult the <a href="https://9n3bwgl2.r.us-west-2.awstrack.me/L0/https:%2F%2Fwww.amazon.jobs%2Fen%2Finternal%2Fprivacy_page/1/02010000dqf498qe-5521e76a-uvmk-bqad-lkkb-je8ekvgnaig0-000000/XYrTf9yXHEhbAnkrNS9gKUjIHkg=433">Employee Privacy Notice</a>.

    
  </span></p>


<div class="font-small font-italic"><p>Please don't reply to this email, as we can't review or respond to messages at this address.</p></div>


                      
                      </div>
                  </td>
