<p>Thanks for applying to Amazon! We've received your application for the <a href="https://9n3bwgl2.r.us-west-2.awstrack.me/L0/https:%2F%2Famazon.jobs%2Fjobs%2F2971498/1/02010000sqeaoqpb-n7tkm9s0-2mmi-vi3c-hhaa-6rmkknhne3g0-000000/1repSr5WOSf6J4x5-uhO0_OyHsk=433">Data Engineer, Accounting</a> (ID: 2971498) position.</p><h2>What happens next?</h2><p>If we decide to move forward with your application, the Amazon recruiting team will reach out to discuss next steps. Any updates to your application status will be reflected on your Application dashboard, so be sure to check back regularly.</p>

  <div class="btn-container">
    <a href="https://9n3bwgl2.r.us-west-2.awstrack.me/L0/https:%2F%2Faccount.amazon.jobs%2Fcandidate%2Fdashboard%2Fapplications/1/02010000sqeaoqpb-n7tkm9s0-2mmi-vi3c-hhaa-6rmkknhne3g0-000000/fIxEZ8EKCeBP3AaufOQPBJ2C-zI=433" class="btn">Go to your application dashboard</a>
  </div>

<p>Explore our <a href="https://9n3bwgl2.r.us-west-2.awstrack.me/L0/https:%2F%2Fwww.amazon.jobs%2Fcontent%2Fen%2Fhow-we-hire%2Finterviewing-at-amazon%3Fcmpid=AS_OTBD200012B/1/02010000sqeaoqpb-n7tkm9s0-2mmi-vi3c-hhaa-6rmkknhne3g0-000000/E96R4_gbpuM_nPAfMyF5hn3Z2mE=433">interview resources</a> for more information on the hiring process and how to prepare for interviews. To learn more about our peculiar culture, visit <a href="https://9n3bwgl2.r.us-west-2.awstrack.me/L0/https:%2F%2Famazon.jobs/1/02010000sqeaoqpb-n7tkm9s0-2mmi-vi3c-hhaa-6rmkknhne3g0-000000/0KeAM-8c7vXLhj-tSq-wUEB_x_Q=433">Amazon.jobs</a>, and get the latest Amazon news and stories by following our <a href="https://9n3bwgl2.r.us-west-2.awstrack.me/L0/https:%2F%2Fblog.aboutamazon.com%2F/1/02010000sqeaoqpb-n7tkm9s0-2mmi-vi3c-hhaa-6rmkknhne3g0-000000/gx5wLTDSftFLD3r40NB_0kZUkj8=433">Day One blog</a>.</p>


<p>Best regards,<br /><span class="font-bold">Amazon Recruiting Team</span></p>


  <span class="font-small font-italic"><p>
    
      Amazon is an equal opportunity employer. Protecting your privacy and the security of your data are longstanding top priorities for Amazon. If you are an external candidate, please consult our <a href="https://9n3bwgl2.r.us-west-2.awstrack.me/L0/https:%2F%2Famazon.jobs%2Fprivacy%2Fglobal/1/02010000sqeaoqpb-n7tkm9s0-2mmi-vi3c-hhaa-6rmkknhne3g0-000000/9ip_hiI8v68ttiFaaDi1bUbe0UM=433">Privacy Notice</a> to know more about how we collect, use, and transfer the personal data of our candidates. You can let us know if you do not want to be contacted for recruitment purposes. Please refer to the "What are my rights under applicable data protection laws?" section of the <a href="https://9n3bwgl2.r.us-west-2.awstrack.me/L0/https:%2F%2Famazon.jobs%2Fprivacy%2Fglobal/2/02010000sqeaoqpb-n7tkm9s0-2mmi-vi3c-hhaa-6rmkknhne3g0-000000/ip9sBeCB7hoCiul102BYAwD8fGA=433">Notice</a> for more information. If you are an internal candidate, please consult the <a href="https://9n3bwgl2.r.us-west-2.awstrack.me/L0/https:%2F%2Fwww.amazon.jobs%2Fen%2Finternal%2Fprivacy_page/1/02010000sqeaoqpb-n7tkm9s0-2mmi-vi3c-hhaa-6rmkknhne3g0-000000/0GbZuNR4ZDWGX2Ggt9xO8XiED2E=433">Employee Privacy Notice</a>.

    
  </span></p>


<div class="font-small font-italic"><p>Please don't reply to this email, as we can't review or respond to messages at this address.</p></div>


                      
