                    <div style="margin: 0; border-top: solid #FF8900 4px;"></div>
                    <div style="padding: 20px">
                      
                        <h1>Hi Amit,</h1>
<p>Thanks for applying to Amazon! We've received your application for the <a href="https://9n3bwgl2.r.us-west-2.awstrack.me/L0/https:%2F%2Famazon.jobs%2Fjobs%2F3003288/1/02010000o4bjd7kr-3uc6s7me-f217-n2h1-47m3-0jfftil3s0g0-000000/tgdkCZm-OqZJo2ywerAGKbUSrjk=430">Machine Learning Engineer, Amazon General Intelligence (AGI)</a> (ID: 3003288) position.</p><h2>What happens next?</h2><p>If we decide to move forward with your application, the Amazon recruiting team will reach out to discuss next steps. Any updates to your application status will be reflected on your Application dashboard, so be sure to check back regularly.</p>

  <div class="btn-container">
    <a href="https://9n3bwgl2.r.us-west-2.awstrack.me/L0/https:%2F%2Faccount.amazon.jobs%2Fcandidate%2Fdashboard%2Fapplications/1/02010000o4bjd7kr-3uc6s7me-f217-n2h1-47m3-0jfftil3s0g0-000000/OpG9IWBD1-Ffkqaa0TYRdikAarI=430" class="btn">Go to your application dashboard</a>
  </div>

<p>Explore our <a href="https://9n3bwgl2.r.us-west-2.awstrack.me/L0/https:%2F%2Fwww.amazon.jobs%2Fcontent%2Fen%2Fhow-we-hire%2Finterviewing-at-amazon%3Fcmpid=AS_OTBD200012B/1/02010000o4bjd7kr-3uc6s7me-f217-n2h1-47m3-0jfftil3s0g0-000000/jXmcY-_fpZeVhiSdNp__zPWR6Pg=430">interview resources</a> for more information on the hiring process and how to prepare for interviews. To learn more about our peculiar culture, visit <a href="https://9n3bwgl2.r.us-west-2.awstrack.me/L0/https:%2F%2Famazon.jobs/1/02010000o4bjd7kr-3uc6s7me-f217-n2h1-47m3-0jfftil3s0g0-000000/YNVyiAYbNDfhKZFfSxVpVD1yUGc=430">Amazon.jobs</a>, and get the latest Amazon news and stories by following our <a href="https://9n3bwgl2.r.us-west-2.awstrack.me/L0/https:%2F%2Fblog.aboutamazon.com%2F/1/02010000o4bjd7kr-3uc6s7me-f217-n2h1-47m3-0jfftil3s0g0-000000/F8JjOjFvi00h6nFu3YSk5qhjrQQ=430">Day One blog</a>.</p>


<p>Best regards,<br /><span class="font-bold">Amazon Recruiting Team</span></p>


  <span class="font-small font-italic"><p>Amazon is an equal opportunity employer. Protecting your privacy and the security of your data are longstanding top priorities for Amazon. If you are an external candidate, please consult our <a href="https://9n3bwgl2.r.us-west-2.awstrack.me/L0/https:%2F%2Famazon.jobs%2Fprivacy%2Fglobal/1/02010000o4bjd7kr-3uc6s7me-f217-n2h1-47m3-0jfftil3s0g0-000000/3b6QzlpnUOtKfLl-3eJP8Etzplg=430">Privacy Notice</a> to know more about how we collect, use, and transfer the personal data of our candidates. You can let us know if you do not want to be contacted for recruitment purposes. Please refer to the "What are my rights under applicable data protection laws?" section of the <a href="https://9n3bwgl2.r.us-west-2.awstrack.me/L0/https:%2F%2Famazon.jobs%2Fprivacy%2Fglobal/2/02010000o4bjd7kr-3uc6s7me-f217-n2h1-47m3-0jfftil3s0g0-000000/AoE_88Bdi78SrfE7LKL0giBfTUo=430">Notice</a> for more information. If you are an internal candidate, please consult the <a href="https://9n3bwgl2.r.us-west-2.awstrack.me/L0/https:%2F%2Fwww.amazon.jobs%2Fen%2Finternal%2Fprivacy_page/1/02010000o4bjd7kr-3uc6s7me-f217-n2h1-47m3-0jfftil3s0g0-000000/QwR6wpp8Nbf10YqzdJN0RA2Tp24=430">Employee Privacy Notice</a>.
</p></span>


<div class="font-small font-italic"><p>Please don't reply to this email, as we can't review or respond to messages at this address.</p></div>


                      
