                        <h1>Hi Amit,</h1>
<p>Thanks for applying to Amazon! We've received your application for the <a href="https://9n3bwgl2.r.us-west-2.awstrack.me/L0/https:%2F%2Famazon.jobs%2Fjobs%2F3003279/1/020100001ad4ssut-4bahgk4e-1ucv-2hvc-tg9k-hsmr2h9cc9g0-000000/SDD1xJZ5GUG7kHFDE95lA7VbYU0=430">Applied Scientist, Artificial General Intelligence</a> (ID: 3003279) position.</p><h2>What happens next?</h2><p>If we decide to move forward with your application, the Amazon recruiting team will reach out to discuss next steps. Any updates to your application status will be reflected on your Application dashboard, so be sure to check back regularly.</p>

