                    <div style="padding: 20px">
                      
                        <h1>Hi Amit,</h1>
<p>Thanks for applying to Amazon! We've received your application for the <a href="https://9n3bwgl2.r.us-west-2.awstrack.me/L0/https:%2F%2Famazon.jobs%2Fjobs%2F2925950/1/020100002j1v95ks-57vr3mus-fnek-26lh-ol65-lhq1j3f4kgo0-000000/S4WTSrZC7HdKP-45WFABIR1Zwv0=429">Delivery Consultant- GenAI/ML, AWS, Industries</a> (ID: 2925950) position.</p><h2>What happens next?</h2><p>If we decide to move forward with your application, the Amazon recruiting team will reach out to discuss next steps. Any updates to your application status will be reflected on your Application dashboard, so be sure to check back regularly.</p>

  <div class="btn-container">
    <a href="https://9n3bwgl2.r.us-west-2.awstrack.me/L0/https:%2F%2Faccount.amazon.jobs%2Fcandidate%2Fdashboard%2Fapplications/1/020100002j1v95ks-57vr3mus-fnek-26lh-ol65-lhq1j3f4kgo0-000000/fnTouV8rSjaCejpJB67Z4LGYVfs=429" class="btn">Go to your application dashboard</a>
  </div>

<p>Explore our <a href="https://9n3bwgl2.r.us-west-2.awstrack.me/L0/https:%2F%2Fwww.amazon.jobs%2Fcontent%2Fen%2Fhow-we-hire%2Finterviewing-at-amazon%3Fcmpid=AS_OTBD200012B/1/020100002j1v95ks-57vr3mus-fnek-26lh-ol65-lhq1j3f4kgo0-000000/ISvG5ABf2jQwHUHbsAAMPKgyiyg=429">interview resources</a> for more information on the hiring process and how to prepare for interviews. To learn more about our peculiar culture, visit <a href="https://9n3bwgl2.r.us-west-2.awstrack.me/L0/https:%2F%2Famazon.jobs/1/020100002j1v95ks-57vr3mus-fnek-26lh-ol65-lhq1j3f4kgo0-000000/yRW1SrlVaO97ZK7u4iFve2q0-Y8=429">Amazon.jobs</a>, and get the latest Amazon news and stories by following our <a href="https://9n3bwgl2.r.us-west-2.awstrack.me/L0/https:%2F%2Fblog.aboutamazon.com%2F/1/020100002j1v95ks-57vr3mus-fnek-26lh-ol65-lhq1j3f4kgo0-000000/vJGmhYP_5PTbLkSq-Ylzy8jQDJE=429">Day One blog</a>.</p>


<p>Best regards,<br /><span class="font-bold">Amazon Recruiting Team</span></p>


