Subject: [External Email] Thank You for Your Application – Let's Stay Connected


Hi&nbsp;Amit,
Thank you for applying for theSoftware Engineer - AI/ML&nbsp;position at ServiceNow.
We appreciate the effort you put into your application and your enthusiasm for joining our team. While your skills and background are impressive, we have decided to move forward with another candidate for this role. This was not an easy decision as we received applications from many talented individuals, including you.&nbsp;&nbsp;
We believe in the power of people and their potential to make a difference. Our culture and People Pact reflect our commitment to fostering an environment where everyone feels valued, respected, and empowered to grow.&nbsp;&nbsp;
We hope that you consider other roles at ServiceNow in the future. You can visit our Careers Page and apply for new opportunities based on your career aspirations and qualifications. Stay engaged with Now Learning to build in-demand ServiceNow skills through self-paced courses and real-time training sessions. And remember to follow us on our ServiceNow LinkedIn page to stay connected.&nbsp;
Thank you for your interest in ServiceNow, and we invite you to join our Talent Community for company updates.
Sincerely,
The ServiceNow Talent Acquisition Team&nbsp;

