                        <h1>Hi Amit,</h1>
<p>Thank you for your application for the position of <a href="https://9n3bwgl2.r.us-west-2.awstrack.me/L0/https:%2F%2Famazon.jobs%2Fjobs%2F2873140/1/0201000091vr0kiv-b4ifa0gb-inh1-st6t-3bos-v0fiumpifd80-000000/OpdAJzKnDvHA1GupXAquXbKT09w=411">ML Data Associate II</a> (ID: 2873140). After careful consideration and review of your application, we have decided to progress with other candidates for this role. While we are not able to provide additional feedback or information about this decision, we would like to keep in touch regarding future job opportunities.</p>


