m/us/en>Candidate Home page</A>.  <br><br>We also encourage you to visit our careers site to explore other positions for which you are qualified and may meet your interests, or you can text “CVS” to 29000 from your mobile device to chat with our virtual recruiting assistant to find open positions near you. <br><br>As a gesture of support and encouragement in your continued search, we would like to offer you access to a free virtual career development platform. When you register, you will have access to resources such as research, networking, resume building, video interviewing practice, targeted job searches, and more. Utilizing professionally developed resources like this can dramatically reduce the time it takes to land a new job. If you would like, you can get started now by <A HREF=https://cvshealthcareers.yournextstep.com/users/sign_up?direct=XM73OrS-nKtg6Gk1>clicking here</A> to enroll. You can unsubscribe at any time. <br> <br>Thank you again for your interest in a career at CVS Health.<br><br>Sincerely,<br><br>CVS Health Talent Acquisition</div></td></tr></table></div><!--[if mso | IE]></td><![endif]--><!--[if mso | IE]><![endif]--><!--[if mso | IE]></table><![endif]--></td></tr></tbody></table></div><!--[if mso | IE]></td></tr></table><![endif]--><!--[if mso | IE]><table align="center" border="0" cellpadding="0" cellspacing="0" style="width:600px;" width="600px" ><tr><td style="line-height:0px;font-size:0px;mso-line-height-url:exactly;"><![endif]--><div style="margin:0px auto;max-width:600px;"><table align="center" border="0" cellpadding="0" cellspacing="0" role="presentation" style="width:100%;" ><tbody><tr><td style="direction:ltr;font-size:0px;padding:0px;text-align:center;display:table;width:100%;"><!--[if mso | IE]><table role="presentation" border="0" cellpadding="0" cellspacing="0" ><![endif]--><!--[if mso | IE]><tr><![endif]--><!--[if mso | IE]><td style="vertical-align:middle;width:600px;background-color:#ffffff;" ><![endif]--><div style="font-size