			<p id="arial-black">Thank you for giving us the opportunity to consider you for employment. As you can imagine, finding the right talent is one of our greatest challenges. After careful consideration, we have decided not to pursue you further as a candidate for&nbsp;<span contenteditable="false">AI/Machine Learning Engineering Intern</span>. Please visit our website to apply for any other positions of interest or to create a job alert.<br />
